import React, { Component } from 'react';
import Cardlist from './cardlist'
import { Robots } from './robots'
import SearchBox from './searchBox'


const state = {
    robots: Robots,
    searchfeild: ''
}

class App extends Component {
  render()  {
    return (
        <div className='tc'>
            <h1>Robofriends</h1>
            <SearchBox />
            <Cardlist robots={Robots}/>
        </div>    
    );
  }
}

export default App;
